#include <stdio.h>
#include "onnxruntime_c_api.h"

const OrtApi *g_ort = NULL;

#define ORT_ABORT_ON_ERROR(expr)                                               \
  do {                                                                         \
    OrtStatus *onnx_status = (expr);                                           \
    if (onnx_status != NULL) {                                                 \
      const char *msg = g_ort->GetErrorMessage(onnx_status);                   \
      fprintf(stderr, "%s\n", msg);                                            \
      g_ort->ReleaseStatus(onnx_status);                                       \
      abort();                                                                 \
    }                                                                          \
  } while (0);

int main(int argc, char const *argv[]) {
  const OrtApiBase *ptr_api_base = OrtGetApiBase();
  g_ort = ptr_api_base->GetApi(ORT_API_VERSION);
  OrtEnv *env;
  ORT_ABORT_ON_ERROR(g_ort->CreateEnv(ORT_LOGGING_LEVEL_WARNING, "test", &env));
  OrtSessionOptions *session_options;
  ORT_ABORT_ON_ERROR(g_ort->CreateSessionOptions(&session_options));

  OrtCUDAProviderOptions o;
  memset(&o, 0, sizeof(o));
  o.cudnn_conv_algo_search = EXHAUSTIVE;
  o.gpu_mem_limit = SIZE_MAX;
  ORT_ABORT_ON_ERROR(
      g_ort->SessionOptionsAppendExecutionProvider_CUDA(session_options, &o));
  g_ort->ReleaseSessionOptions(session_options);
  g_ort->ReleaseEnv(env);
  return 0;
}
